import React from 'react'
import './Url.css'
import 'tachyons'

const Url = () => {
	return (
		<div>
			<p>Enter the image link to detect a face</p>
			<div classname='ba '>
				<input className='bg-light-blue ma3 w-40' type= 'text' placeholder='Enter the URL'></input>
				<button className='bg-light-blue ma3 w3'>Detect</button>
			</div>
		</div>
	);
}

export default Url;
